import React from 'react';
import { View, SafeAreaView } from 'react-native';
import { Button, Card, TextInput } from 'react-native-paper';
import { loginStyle } from './loginStyle';

export default class LoginScreen extends React.Component {
    render() {

        return (

            <SafeAreaView style={loginStyle.content}>
                <View style={loginStyle.View}>
                    <Card>
                        <Card.Content>
                            <Card.Title title="Delivery app" titleStyle={loginStyle.cardTitle}></Card.Title>
                            <TextInput label="Email" keyboardType='"email-address' ></TextInput>
                            <TextInput label="Password" secureTextEntry={true} style={loginStyle.case}></TextInput>
                            <Button uppercase={false}>Forget email/password</Button>
                            <Button mode="contained" onPress={() => this.props.navigation.navigate("Home")}>Login</Button>
                            <Button onPress={() => this.props.navigation.navigate("register")}>Register</Button>
                        </Card.Content>

                    </Card>
                </View>
            </SafeAreaView>

        )
    }
}
